import Home from './componentsblog/Home'
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/blog" element={<Home />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
